import React from "react";
import Data from "./data"



class Users extends React.Component {

  render() {
    return (
      <div>
        {
          this.users.map((el) => (
            <div>
              <h3>{el.firstname} {el.lastname}</h3>
              <p>{el.bio}</p>
            </div>
          ))
        }
      </div>
    )
  }
}

export default Users
